);
CREATE TABLE CHOIR_PRACTICE (PRACTICE_CD varchar(10) NOT NULL,  PRACTICE_NM varchar(30) NOT NULL,  USE_YN char(1) NOT NULL default 'Y',  ORDERBY_NO int(11) NOT NULL);
