CREATE INDEX IDX_MEMBER_PART_2 ON CHOIR_MEMBER (PART_CD ASC, POSITION_CD ASC, STATUS_CD ASC);
CREATE INDEX IDX_MEMBER_PART_1 ON CHOIR_MEMBER (PART_CD ASC, STATUS_CD ASC);
COMMIT;


